import * as actionType from '../contstants/actionTypes';

const authReducer = (state = { authData: null }, action) => {
  switch (action.type) {
    case actionType.AUTH:
        console.log(action?.data)
      return state;
    default:
      return state;
  }
};

export default authReducer;
